import React from 'react';

import './card-list.style.css';

export const CardList = props => {
    return <div className='card-items'>
        {
          this.state.techbros.map(techbro => (
            <h1 key={techbro.id}>{techbro.name}</h1>
          ))
        }  
    </div>;
};
